const Navbar = () => {

    return ( 
        <nav className="navbar">
        <h1>Sams Dashboard</h1>
        <div className="links">
        <a href="/">Home</a>
        <a href="/create">Create</a>
        </div>
        </nav>
    )
}
 
export default Navbar;
